import React from "react";

const Navbar = () => {
  return (
    <nav className="navbar">
      <div >
        Hello<span style={{ color: "green" }}>.</span>
      </div>
      <ul className="menu">
        <li>Business solutions </li>
        <li>Explore </li>
        <li>English </li>
        <li>Become a Seller </li>
        <li>Sign in </li>
      </ul>
        <button>Join</button>
    </nav>
  );
};

export default Navbar;
